import React from 'react'
import "./App.css";

import { BrowserRouter, Routes, Route, Router} from "react-router-dom"
import SearchMovies from './components/Pages/SearchMovies';


const App = () => {
  return (
  <BrowserRouter>
<Routes>
  <Route path="/" element={<SearchMovies/>} />
</Routes>
</BrowserRouter> 
)
}

export default App
